import React from 'react';
import { Link } from 'react-router-dom';

function Navebar() {
  return (
    <header className="bg-white shadow p-4 flex justify-between items-center sticky top-0 z-10">
      <Link to="/" className="text-xl font-bold text-blue-600">Asiru</Link>
      <nav className="space-x-4">
        <Link to="/" className="text-gray-700 hover:text-blue-600">Home</Link>
        <Link to="/post/new" className="text-gray-700 hover:text-blue-600">Create Post</Link>
        <Link to="/itinerary/new" className="text-gray-700 hover:text-blue-600">Create Itinerary</Link>
      </nav>
    </header>
  );
}

export default Navebar;
